function add_command (connand) {
    let input_log = document.getElementsByClassName("command_input")[0]
  input_log.value = ">"+connand
  let test_input_eixt = document.getElementsByClassName("command_input");

  if (test_input_eixt.length == 0) {
      devlog.err("err");
  } else if (test_input_eixt != 0) {
      c_core();
  }
}
function log_submit() {

    let test_input_eixt = document.getElementsByClassName("command_input");

    if (test_input_eixt.length == 0) {
        devlog.err("err");
    } else if (test_input_eixt != 0) {
        c_core();
    }
}
function c_core(...arr) {
    let input_log = document.getElementsByClassName("command_input")[0]
    if (document.getElementsByClassName("command_input")[0].value != "") {
        ch_comm = input_log.value.split(">");
        if (ch_comm.length > 1) {
            devlog.input(ch_comm[1]);
            main_command_panel(ch_comm[1]);
        } else {
            devlog.log(ch_comm[0]);

        }
        input_log.value = ""
    } else {
        devlog.err("err");
    }
}
